import HeaderOnly from "./components/Layout/";
import Following from "./pages/Following";
import Home from "./pages/Home";
import Upload from "./pages/Upload";

const publicRoutes = [
    {
        path: '/',
        component: Home,
    },
    {
        path: '/following',
        component: Following, 
        layout: null
    }, 
    {
        path: '/upload',
        component: Upload,
        layout: HeaderOnly
    }
]

export {publicRoutes};
